@CarlaZambelli17 Um porteiro Mentiu duas vezes seguidas num depoimento que emplicaria um presidente envolvido com milicianos? Eh, deve ser um suicida mesmo.
Eu já desconfiava que essa seria a estratégia da direita. 
Igualmente ao caso Queirós que não deu em nada.

"Il comune di Roma è ormai lontano dai cittadini, vogliamo dare un'alternativa valida ai romani. Migranti? Il governo sta agendo con una politica suicida e anti-italiana".

